selector_to_html = {"a[href=\"#miscellaneous\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Miscellaneous<a class=\"headerlink\" href=\"#miscellaneous\" title=\"Link to this heading\">#</a></h4>", "a[href=\"#usage\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Usage<a class=\"headerlink\" href=\"#usage\" title=\"Link to this heading\">#</a></h2><p>To generate documentation TypeDoc needs to know your project entry point and TypeScript\ncompiler options. It will automatically try to find your <code class=\"docutils literal notranslate\"><span class=\"pre\">tsconfig.json</span></code> file, so you can\njust specify the entry point of your library:</p>", "a[href=\"#arguments\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Arguments<a class=\"headerlink\" href=\"#arguments\" title=\"Link to this heading\">#</a></h3><p>For a complete list of the command line arguments run <code class=\"docutils literal notranslate\"><span class=\"pre\">typedoc</span> <span class=\"pre\">--help</span></code> or visit\n<a class=\"tippyAnchor reference external\" href=\"https://typedoc.org/options/\">our website</a>.</p>", "a[href=\"#typedoc\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">TypeDoc<a class=\"headerlink\" href=\"#typedoc\" title=\"Link to this heading\">#</a></h1><p>Documentation generator for TypeScript projects.</p>", "a[href=\"#documentation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Documentation<a class=\"headerlink\" href=\"#documentation\" title=\"Link to this heading\">#</a></h2><p>For more detailed documentation, the changelog, and TypeDoc documentation rendered with TypeDoc, see https://typedoc.org.</p>", "a[href=\"#installation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installation<a class=\"headerlink\" href=\"#installation\" title=\"Link to this heading\">#</a></h2><p>TypeDoc runs on Node.js and is available as a NPM package.</p>", "a[href=\"#monorepos-workspaces\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Monorepos / Workspaces<a class=\"headerlink\" href=\"#monorepos-workspaces\" title=\"Link to this heading\">#</a></h3><p>If your codebase is comprised of one or more npm packages, you can build documentation for each of them individually\nand merge the results together into a single site by setting <code class=\"docutils literal notranslate\"><span class=\"pre\">entryPointStrategy</span></code> to <code class=\"docutils literal notranslate\"><span class=\"pre\">packages</span></code>. In this mode TypeDoc\nrequires configuration to be present in each directory to specify the entry points. For an example setup, see\nhttps://github.com/Gerrit0/typedoc-packages-example</p>", "a[href=\"#theming\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Theming<a class=\"headerlink\" href=\"#theming\" title=\"Link to this heading\">#</a></h4>", "a[href=\"#contributing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Contributing<a class=\"headerlink\" href=\"#contributing\" title=\"Link to this heading\">#</a></h2><p>This project is maintained by a community of developers. Contributions are welcome and appreciated.\nYou can find TypeDoc on GitHub; feel free to open an issue or create a pull request:\nhttps://github.com/TypeStrong/typedoc</p><p>For more information, read the <a class=\"tippyAnchor reference external\" href=\"https://github.com/TypeStrong/typedoc/blob/master/.github/CONTRIBUTING.md\">contribution guide</a>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
